import Navbar from './components/Navbar.js';
import './styles.css';
import {Route, Routes} from "react-router-dom";
import Inicio from "./routes/Inicio";

function App() {
  return (
    <div className="App">
        <Routes>
          <Route/>
        </Routes>

        <Navbar/>
        <Inicio/>
    </div>
  );
}

export default App;
